import React from "react";

let TableExample = () => {
    return( 
    <div style={{display : "inline-table"}}>
    <table>
        <tr>
        <td><b>Name</b></td>
        <td><b>Number</b></td>
        </tr>

        <tr>
        <td>Siddharth</td>
        <td>8698316883</td>
        </tr>

        <tr>
        <td>Mahima</td>
        <td>9673730944</td>
        </tr>
    </table>
    </div>
    )
}

